●余分なダブつきを抑え、美しさと動きやすさを両立したＮＥＷシルエット採用。胸廻り・裾廻りを従来品より約４ｃｍ引き締め、裾を折り返し仕様（Ｔシャツタイプ）に変更し、前身頃丈を約３ｃｍ伸ばした、タイトシルエットになります。<br>●サイズ：Ｓ・Ｍ・Ｌ・Ｏ・ＸＯ・ＸＡ<br>●機能：吸汗・速乾・ＮＥＷシルエット<br>●素材：ＤＳドライフェイスメッシュ（ポリエステル 100 ％）、切替部：ＤＳドライリバースメッシュ（ポリエステル 100 ％）<br><br>※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。
<br>なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br><br><br>
